import React from 'react';
import { Box, Skeleton, SimpleGrid, Heading, Image } from "@chakra-ui/react";
import SB1 from './SB1.jpg';
import SB2 from './SB2.jpg';
import SB3 from './SB3.jpg';
import SB4 from './SB4.jpg';

const SB = () => {
  const { data, loading, error } = React.useRemoteData();
  if (error) return(<Box children="error" />);

  return (
    <div>

      <Heading
      size = 'xl'
      position = 'relative'
      fontFamily = 'monospace'
      top = '0px'>
        Santa Barbara
      </Heading>

      <SimpleGrid columns={2} spacing="40px">

        <Skeleton isLoaded={!loading}>
          <Image
            position = 'relative'
            src = {SB1}
            alt = "SB1"
          />
        </Skeleton>

        <Skeleton isLoaded={!loading}>
          <Image
            position = 'relative'
            src = {SB2}
            alt = "SB2"
          />
        </Skeleton>

        <Skeleton isLoaded={!loading}>
          <Image
            position = 'relative'
            src = {SB3}
            alt = "SB3"
          />
        </Skeleton>

        <Skeleton isLoaded={!loading}>
          <Image
            position = 'relative'
            src = {SB4}
            alt = "SB4"
          />
        </Skeleton>

      </SimpleGrid>

    </div>
  )
};

export default SB;
